import { Typography } from '@material-ui/core';
import React from 'react';
import Button from '@material-ui/core/Button';

export default function Contact() {

  return (
    <section>
<div></div>
<div>
<Typography>You can direclty choose a time slot in my agenda</Typography>
<Button>Schedule a meeting</Button>
    <Typography>julia.turqueti[at]gmail.com</Typography>
    <Typography>+33 7 68 61 33 57</Typography>
    <Typography>If you are more a LinkedIn person you can also InMail me!</Typography>
    <li><a href="https://example.com">LinkedIn</a></li>
  <li><a href="mailto:m.bluth@example.com">GitHub</a></li>
  <li><a href="tel:+123456789">Phone</a></li>
    </div>
    </section>
  );
}
